import React from 'react';
import { graphql } from "gatsby"
import type { AllBoardsJson } from '../../../src/ts/type/AllBoardsJson';
import { ProjectUtility as util} from '../../ts/module/ProjectUtility';
import '../../style/izakaya/sass/style.scss';


// graphql による情報取得
export const query = graphql`
query BoardQuery($boardId: String!) {
  allBoardsJson(filter: {board: {id: {eq: $boardId}}}) {
    edges {
      node {
        board {
          name
          id
        }
        square {
          goalflag
          id
          event {
            detail
            flag
            minigame
            move
            name
            point
            skip
          }
          minigame {
            detail
            id
            name
          }
          store {
            detail
            name
          }
        }
      }
    }
  }
}`


